import React from "react";

//Calendar item
class CalendarItem extends React.Component{
    constructor(props){
        super(props);
    }
render(){
    return(
        <div className="col">
            <div >
            <label >Subject:
                <div>
            <input type="text" id="NewItemSubject"></input>         
            </div>
            </label>
            
            </div>
            <div>
            <textarea rows="5" id="NewItemText"></textarea>
            </div>
            <div>
            <label htmlFor="NewItemTime">Time:
            <div><input type="time" id ="NewItemTime"></input></div></label>
            </div>
            <div>
            <label htmlFor="NewItemDate">Date:
            <div>
            <input type="date" id ="NewItemDate"></input></div>
            </label>
            
            </div>
        </div>
    )
}

}
export default CalendarItem;
